import React, {Component} from 'react';
import {List, Checkbox, Flex} from "antd-mobile";

import './shopcar.css'


//购物车
class ShopCar extends Component {
    render() {

        return (
            <div>
               <div className={'shopcar'}>
                   {/*<div className={'shop_content'}>*/}
                   {/*    <img src={require('../../common/images/gouwuc.png')} width={'100%'} alt=""/>*/}
                   {/*    <span >购物车还是空的</span>*/}
                   {/*    <button>去逛逛</button>*/}
                   {/*</div>*/}
                   <List>
                       <List.Item
                            thumb={
                                <Checkbox/>
                            }
                       >
                           <div className={'buy_list'}>
                               <img src={require('../../common/images/buy_img.jpg')} width={''} alt=""/>
                               <div>
                                   <div>小米MIX 2S 全网通版 6GB内存 陶瓷标准版 128GB 黑色 128GB</div>
                                   <div><span style={{marginRight:'5px'}}>售价:</span><span style={{color:'#ccc',fontSize:'0.25rem'}}>￥1999</span></div>
                                   <div>123</div>
                               </div>
                           </div>

                       </List.Item>
                   </List>



               </div>

            </div>
        );
    }
}

export default ShopCar;
